import React from "react";
import "./Preview.scss";

export default function Preview() {
  if (!files.length) {
    return null;
  }
  return (
    <>
      {files.map((data, i) => (
        <div key={i}>{data.filename}</div>
      ))}
    </>
    // files.map (file) => <div>{file.filename}</div>
  );
}
